champDescriptors.description:
Sous le prisme de l’activité physique, les actions pourraient être : 

-	Des actions d’éducation à l’usage de l’espace urbain ;
-	Construire avec les habitants et les usagers les conditions favorables à l’usage des aménités urbaines  : renforcer en lien avec les habitants et les usagers les aménagements favorables à une pratique spontanée et ludique des espaces ouverts, espaces verts, naturels, places, promenades, berges, laissant une liberté d’usage et d’appropriation ;
-	Des actions d’accompagnements collectifs de type marches, gestion de plage horaires non encadrées des équipements de proximité… ;
-	Des actions en milieu périscolaire : développer dès le plus jeune âge la promotion de la santé par le sport par le développement de projets intersectoriels (éducation nationale, associations d’éducation populaire, collectivités locales, associations et clubs sportifs, professionnels de santé).

Par exemple :
- Agir sur les leviers environnementaux (des horaires adaptés, information et communication sur l’offre, accessibilité de l’offre) ;
- Agir sur les leviers socio-économiques (accessibilité financière …) ;
- Agir sur les leviers individuels : santé, rapport au corps et estime de soi (analyse des motifs de réticence, motivation, accompagnement vers la pratique…) ;
- Agir sur les leviers institutionnels et liés aux pratiques des professionnels (sensibilisation et formation des professionnels, participation des habitants) 
- Développer des actions d’aller vers.
